import React from "react";
import Header from "./../components/Header";

const $Header = $.header`
  background-color: #fff159;
  margin: 0;
  padding: 7px;
  color: #8f8f8f !important;
  box-shadow: var(--shadow);
`;


const Home = () => {
  return (
    <>
      <Header />
    </>
  );
};

export default Home;
